from locust import HttpUser, task, between
from faker import Faker
import random
import json
import socketio
import requests

fake = Faker()

# Constants
ENDPOINT = 'http://34.70.161.6/socket.io'
API_URL = 'http://34.70.161.6/api/message/'

# Create a Socket.IO client instance
sio = socketio.Client()
NUM_FRIENDS = 10
NUM_MESSAGE = 10
# Define event handlers


@sio.event
def connect():
    print('Connected to server')


@sio.event
def disconnect():
    print('Disconnected from server')


def send_message(body, token):
    """
    Send a message using an HTTP POST request.
    """
    try:
        headers = {'Authorization': f'Bearer {token}'}
        response = requests.post(API_URL, json=body, headers=headers)
        response.raise_for_status()  # Raise an HTTPError on bad responses
        return response.json()
    except requests.RequestException as error:
        print(f'Error in send_message API: {error}')
        return None


def send_message_and_emit(body, token):
    """
    Send a message to the server and emit the 'new message' event.
    """

    data = send_message(body, token)
    if data:
        sio.emit('new message', data)
    else:
        print('Failed to send message and emit event')


class RegisterUser(HttpUser):
    wait_time = between(1, 5)  # Wait time between tasks

    @task
    def register_and_send_message(self):
        url = "/api/auth/register"
        headers = {
            "Content-Type": "application/json"
        }
        # Generate random user data
        email = f"{fake.user_name()}{random.randint(1000, 9999)}@example.com"
        payload = {
            "firstname": fake.first_name(),
            "lastname": fake.last_name(),
            "email": email,
            "password": "password"
        }
        response = self.client.post(url, json=payload, headers=headers)
        token = ""
        if response.status_code == 200:
            print(f"Registered {email}")
            token = response.json().get("token")
            url = "/api/user"
            headers = {
                "Authorization": f"Bearer {token}",
            }
            response = self.client.get(url, headers=headers)
            if response.status_code == 200:
                jsonArr = response.json()
                for _ in range(NUM_FRIENDS):
                    random_index = 0
                    while True:
                        random_index = random.randint(0, len(jsonArr) - 1)
                        if jsonArr[random_index]["email"] != "chatbot@gmail.com":
                            break
                    targetID = jsonArr[random_index]["_id"]
                    url = "/api/chat"
                    headers = {
                        "Authorization": f"Bearer {token}",
                        "Content-Type": "application/json",
                    }
                    body = {
                        "userId": targetID
                    }
                    response = self.client.post(
                        url, headers=headers, data=json.dumps(body))
                    if response.status_code == 200:
                        respArr = response.json()
                        if isinstance(respArr, dict):
                            chatID = respArr['_id']
                        if isinstance(respArr, list):
                            chatID = respArr[0]['_id']

                        print(f"Created chat with {targetID}")
                        print(f"Chat ID with {chatID}")
                        if not sio.connected:
                            try:
                                sio.connect(ENDPOINT)
                            except socketio.exceptions.ConnectionError as e:
                                print(
                                    f"Failed to connect to Socket.IO server: {e}")
                                return
                        for i in range(NUM_MESSAGE):
                            options = ['text', 'voice', 'image']
                            # Probabilitides must sum up to 1
                            probabilities = [0.34, 0.33, 0.33]

                            # random.choices returns a list, so we take the first element
                            option = random.choices(options, probabilities)[0]
                            if option == 'text':
                                print("Sent text message")
                                body = {"chatId": chatID, "message": "text"}
                                send_message_and_emit(body, token)
                            elif option == 'voice':
                                print("Sent voice message")

                                body = {"type": "audio", "chatId": chatID, "message": "data:audio/mpeg;base64,"}
                                url = "/api/message"
                                headers = {
                                    "Authorization": f"Bearer {token}",
                                    "Content-Type": "application/json",
                                }
                                response = self.client.post(
                                    url, headers=headers, data=json.dumps(body))
                                print("Sent voice message")

                            else:
                                print("Sent photo message")
                                url = "/api/chat"
                                headers = {
                                    "Authorization": f"Bearer {token}",
                                    "Content-Type": "application/json",
                                }
                                body = {
                                    "userId": targetID
                                }
                                response = self.client.get(
                                    url, headers=headers, data=json.dumps(body))
                                jsonArrResp = json.loads(response.text)
                                chatBotID = ""
                                for chat in jsonArrResp:
                                    if chat["users"][0]["email"] == "chatbot@gmail.com" or chat["users"][1]["email"] == "chatbot@gmail.com":
                                        chatBotID = chat["_id"]
                                options = ['help', 'bw', 'blurring']
                                # Probabilities must sum up to 1
                                probabilities = [0.2, 0.4, 0.4]

                                # random.choices returns a list, so we take the first element
                                option = random.choices(
                                    options, probabilities)[0]
                                url = "/api/message"
                                headers = {
                                    "Authorization": f"Bearer {token}",
                                    "Content-Type": "application/json",
                                }

                                if option == 'help':
                                    body = {"chatId": chatBotID,
                                            "message": "{\"action\":\"help\"}"}
                                elif option == 'bw':
                                    body = {"chatId": chatBotID,
                                            "message": "{\"action\":\"bw\",\"image\":\"data:image/png;base64,\"}"
                                            }
                                elif option == 'blurring':
                                    body = {"chatId": chatBotID,
                                            "message": "{\"action\":\"blurring\",\"image\":\"data:image/png;base64,\"}"}
                                response = self.client.post(
                                    url, headers=headers, data=json.dumps(body))
                        print("Messages sent")
            else:
                print(f"Failed to fetch user data: {
                      response.status_code} - {response.text}")
        else:
            print(f"Failed to register {email}: {
                  response.status_code} - {response.text}")


if __name__ == "__main__":
    import os
    os.system("locust -f locustfile.py")
